/*
	Problem 54
	
	Given a string of poker hand, the hand is first converted into a 2-dimensional integer array.
	Cards are ranked from 2 - 14 (so "2" becomes 2, "Ace" becomes 14)
	Suits are: H,C,S,D , mapped from 1 - 4

	The hand is then ranked: "rankHand" returns an array:
		- first element contains the rank [0] (i.e. "high card", "flush", etc.)
		- second and third element contain the highest value the rank is made up with (third element is only used for two pairs)
		- fourth to eighth element is the value of the cards ordered

	Two hands are compared by simply stepping through both arrays and stopping if one is higher

*/

package main

import (
	"fmt"
)

func makeHand(s [5]string) [5][2]int {
	hand := [5][2]int{}

	for i, v := range s {
		number := int(v[0])
		suite := int(v[1])

		card := [2]int{}

		if number >= 50 && number <= 57 {
			card[0] = number - 48
		} else if number == 84 {
			card[0] = 10
		} else if number == 74 {
			card[0] = 11
		} else if number == 81 {
			card[0] = 12
		} else if number == 75 {
			card[0] = 13
		} else if number == 65 {
			card[0] = 14
		} else {
			fmt.Println("hand number problem", number, v)
		}

		suites := [4]int{72,67,83,68}

		for i, c := range suites {
			if c == suite {
				card[1] = i+1
				break
			}
		}

		if card[1] == 0 {
			fmt.Println("hand suite problem", number, v)
		}

		hand[i] = card
	}

	return hand
}

func orderHand(hand [5][2]int) [5][2]int {
	ordered := [5][2]int{}

	for i := 0; i<5; i++ {
		highestVal := -1
		index := 0

		for j, v := range hand {
			if v[0] > highestVal {
				highestVal = v[0]
				index = j
			}
		}

		ordered[i] = hand[index]
		hand[index] = [2]int{}
	}

	return ordered
}

func checkStraightSuit(hand [5][2]int) (bool, bool) {
	sameSuit := true
	isStraight := true

	for i, v := range hand {
		if i == 0 {
			continue
		}

		if (hand[i-1][0] - 1) != v[0] {
			isStraight = false
		}
		if (hand[i-1][1]) != v[1] {
			sameSuit = false
		}
	}

	return isStraight, sameSuit
}

func groupOfAKind(hand [5][2]int) [][2]int {
	result := [][2]int{}

	current := [2]int{hand[0][0],1}
	for i := 1; i<5; i++ {
		v := hand[i]
		if v[0] == current[0] {
			current[1]++
		} else {
			if current[1] > 1 {
				result = append(result, current)
			}

			current = [2]int{v[0],1}
		}
	}

	if current[1] > 1 {
		result = append(result, current)
	}

	return result
}

func rank(hand [5][2]int) [8]int {
	ranked := [8]int{}

	hand = orderHand(hand)

	// first step: we can already put in the high cards
	for i, v := range hand {
		ranked[i+3] = v[0]
	}

	// now go through all possible ranks from top to bottom and fill in 
	isStraight, sameSuit := checkStraightSuit(hand)

	// 1. Check the whole straight stuff
 	if isStraight {

 		// royal flush, straight flush
		if sameSuit {
			if hand[0][0] == 14 {

				// royal flush
				ranked[0] = 10
				ranked[1] = 14
			} else {
				// straight flush
				ranked[0] = 9
				ranked[1] = hand[0][0]
			}
	
		} else {
			// regular straight
			ranked[0] = 5
			ranked[1] = hand[0][0]
		}

		return ranked
 	} else {
		groups := groupOfAKind(hand)

		numberOfPairs := 0
		highPair := [2]int{}
		highestThreeOfAKind := 0

		// check if we have four of a kind
		for _, group := range groups {
			if group[1] == 4 {
				ranked[0] = 8
				ranked[1] = group[0]

				return ranked
			}

			if group[1] == 2 {
				numberOfPairs++
				highPair[numberOfPairs-1] = group[0]
			}

			if group[1] == 3 {
				highestThreeOfAKind = group[0]
			}
		} 		

		// full house
		if highestThreeOfAKind > 0 && numberOfPairs > 0 {
			ranked[0] = 7
			ranked[1] = highestThreeOfAKind
			ranked[2] = highPair[0]
		} else if sameSuit {
			// flush
			ranked[0] = 6
		} else if highestThreeOfAKind > 0 {
			ranked[0] = 4
			ranked[1] = highestThreeOfAKind
		} else if numberOfPairs == 2 {
			ranked[0] = 3
			if highPair[0] > highPair[1] {
				ranked[1] = highPair[0]
				ranked[2] = highPair[1]
			} else {
				ranked[1] = highPair[1]
				ranked[2] = highPair[0]
			}
		} else if numberOfPairs == 1 {
			ranked[0] = 2
			ranked[1] = highPair[0]
		} else {
			ranked[0] = 1
			ranked[1] = hand[0][0]
		}

 	}

	return ranked
}

